import React from 'react';
import { StyleSheet, Text, View, Image, TextInput } from 'react-native';

const Register = (props) => {
  return (
    <View style={stil.ekran}>
      <Image style={stil.slika} source={ require('../constants/images/image.jpg')} />
      <Text style= { stil.naslov}>FITNESS </Text>
      <Text style= { stil.opis}> 
        Prilagodite se kuÄ‡nim vjezbama i videozapisima-
        Cardio, Pilates, HIIT, i ostalo
      </Text>

      <View style= {stil.unos}>
      <TextInput placeholder='E-mail' placeholderTextColor='#FE2F57' style= {stil.input} />
      </View>

      <View style= {stil.unos}>
      <TextInput secureTextEntry placeholder='Password' placeholderTextColor='#FE2F57' style= {stil.input} />
      </View>

      <View style= {stil.unos}>
      <TextInput secureTextEntry placeholder='Confirm Password' placeholderTextColor='#FE2F57' style= {stil.input} />
      </View>

<View style= {stil.natpis}>
  <Text style={ stil.tekst} onPress={()=> { 
    props.navigation.replace('SveKategorije')
}}>Register.</Text>
</View>
    </View>
  );
};

const stil = StyleSheet.create({
  natpis: {
    marginHorizontal:55,
    alignItems:'center',
    justifyContent:'center',
    marginTop:20,
    backgroundColor: '#FE2F57',
    paddingVertical:10,
    borderRadius: 23,

  },
  tekst: {
    color: 'white',
    fontFamily: 'open-sans'
  },
  input: {
    paddingHorizontal: 10
  },
  ikona: {
    color: '#FE2F57',
    
  },
  unos:{
    flexDirection: 'row',
    alignItems: 'center',
    marginHorizontal: 55,
    borderWidth: 2,
    marginTop:15,
    paddingHorizontal: 10,
    borderColor: '#FE2F57',
    borderRadius: 23,
    paddingVertical: 2
  },
  opis: {
    alignSelf: 'center',
    fontFamily: 'open-sans',
    marginHorizontal:55,
    marginTop: 5,
    opacity: 0.5
  },
  naslov: {
    fontSize: 30,
    fontFamily: 'open-sans-bold',
    alignSelf: 'center'
  },
  slika: {
    width: '100%',
    height: '45%'
  },
  ekran: {
    backgroundColor: '#fff',
    height: '100%',
  },
});

export default Register
